angular.module('livrio.controllers')

.controller('friend_invite_ctrl', function($scope, $rootScope, $filter, $cordovaSocialSharing, $cordovaToast) {

    var trans = $filter('translate');

    var invite_image = 'data:image/png;base64,';
    var invite_msg = trans('friend_invite.invite_msg');
    var invite_subject = trans('friend_invite.invite_subject');
    var invite_link = trans('friend_invite.invite_link');


    $scope.info_title = String.format(trans('friend_invite.info_title'),$rootScope.user.first_name);



    $scope.sending = false;


    $scope.onInviteWhatsApp = function() {
        $scope.sending = true;

        $cordovaSocialSharing.shareViaWhatsApp(invite_msg, invite_image, invite_link)
        .then(function(result) {
            $scope.sending = false;
            $cordovaToast.showLongBottom(trans('friend_invite.toast_share_whatsapp'));
        }, function(err) {
            $scope.sending = false;
            $cordovaToast.showLongBottom(trans('friend_invite.toast_share_error'));
        });
    };

    $scope.onFacebook = function() {
        $scope.sending = true;

        $cordovaSocialSharing.shareViaFacebook(invite_msg, invite_image, invite_link)
        .then(function(result) {
            $scope.sending = false;
            $cordovaToast.showLongBottom(trans('friend_invite.toast_share_facebook'));
        }, function(err) {
            $scope.sending = false;
            $cordovaToast.showLongBottom(trans('friend_invite.toast_share_error'));
        });
    };

    $scope.onShared = function() {
        $scope.sending = true;

        $cordovaSocialSharing.share(invite_msg, invite_subject, invite_image, invite_link)
        .then(function(result) {
            $scope.sending = false;
            $cordovaToast.showLongBottom(trans('friend_invite.toast_share'));
        }, function(err) {
            $scope.sending = false;
            $cordovaToast.showLongBottom(trans('friend_invite.toast_share_error'));
        });
    };

});
